(11616, 730, 1210, 7, '色烈芬', '', '2008-12-31 00:00:00', 0000, 20, 0, 4, '', '詞/曲：吳听徹\n編曲：吳听徹/陳中慧/許逸喬(Josh)\n\n\n有一線合聲\n錯位的天真\n我撰的失了本份\n還是被耍了\n\n分貝還未撐\n力道不夠狠\n用聲樂掃盡微塵\n擁抱激烈的\n\n取暖了沒 夠暖了沒\n別啞了誰 還保持最純潔\n\n妳夠了沒 夠暖了沒\n離開了誰 拭淨妳曾出現\n\n厭倦了沒 夠冷了沒\n別踏過誰 下一秒就忘卻\n\n妳夠了沒 夠冷了沒\n擦肩過誰 請別再搭肩\n\n\n色烈芬\n造熱著承頌不起的陌生\n才問誰擲了\n最有心機卻最純真的\n神 聖 腳 本\n\n色烈芬\n燃燒了最不起眼的眼神\n才肯坦誠的\n我看見了 卻是瞎的\n真實表面竟沒有指紋\n\n取暖了沒 夠暖了沒\n別啞了誰 還保持最純潔\n\n妳夠了沒 夠暖了沒\n離開了誰 拭淨妳曾出現\n\n厭倦了沒 夠冷了沒\n別踏過誰 下一秒就忘卻\n\n妳夠了沒 夠冷了沒\n擦肩過誰 請別再搭肩\n\n\n色烈芬\n造熱著承頌不起的陌生\n才問誰擲了\n最有心機卻最純真的\n神 聖 腳 本\n\n色烈芬\n燃燒了最不起眼的眼神\n才肯坦誠的\n我看見了 卻是瞎的\n真實表面竟沒有指紋\n\n\n色烈芬\n造熱著承頌不起的陌生\n才問誰擲了\n最有心機卻最純真的\n神 聖\n神聖的腳本\n\n燃燒了最不起眼的眼神\n才肯坦誠的\n我看見了 卻是瞎的\n真實表面竟沒有指紋\n\n曾泛紅的\n褪色\n', 307, '', '', '', '', '', '', 1, 1, 0, '2009-01-02 18:58:57', '2015-03-12 13:36:23', '0000-00-00 00:00:00'),
(11617, 730, 1210, 8, '晴', '', '2008-12-31 00:00:00', 0000, 20, 0, 4, '', '詞/曲：吳听徹\n編曲：吳听徹/陳中慧\n\n\n新琴盒裡沒有新琴\n要演奏的總譜裡沒有筆記\n到了第幾個小節\n才發現听徹不會拉顫音\n指揮 才準備 喊停\n\n天不天晴沒有心情\n彈拉赫的協奏曲濫情自己\n那過分困難的樂句\n三秒膠黏一起\n我也可以不要你\n\n偷偷弱起\n切分要夠秘密\n當騙人精\n靈魂不夠圓滿\n才盼粉飾太平\noh ! 小心\n在那反覆記號被大大圈起\n要故意略過\n直接奏到 下一個音\n\n新琴盒裡沒有新琴\n要演奏的總譜裡沒有筆記\n到了第幾個小節\n才發現听徹不會拉顫音...\n\n指揮 才準備 喊停\n\n\n天不天晴沒有心情\n彈拉赫的協奏曲...\n\n濫情自己\n那過分困難的樂句\n三秒膠黏一起\n \n我也可以不要你\n\n\n偷偷弱起\n切分要夠秘密\n當騙人精\n靈魂..\n靈..\n靈魂不夠圓滿\n才盼粉飾太平\noh ! 小心\n在那反覆記號\n被..喂～\n被大大圈起\n要故意略過\n直接奏到 下一個音\n\n\n偷偷弱起\n切分要夠秘密\n當騙人精\n靈魂不夠圓滿\n才盼粉飾太平\noh ! 小心\n在那反覆記號被大大圈起\n要故意略過\n直接奏到 下一個音\n\nOS：\n蔡維真妳要去哪裡\n我要去上廁所啦\n我也要去我也要去我也要去...\n嘖\n\n\n吳听徹 你進來女廁幹麼啦\n哈哈哈', 301, '', '', '', '', '', '', 1, 1, 0, '2009-01-02 19:03:55', '2015-03-12 13:36:23', '0000-00-00 00:00:00'),
(11618, 730, 1210, 9, '歿奏', '', '2008-12-31 00:00:00', 0000, 20, 0, 4, '', '詞/曲：吳听徹\n編曲：吳听徹/陳中慧\n\n\n華麗的玫瑰妝飾誰的眼\n噓 是秘密\n不存在睜開雙眼的燙\n奪走一曲幻想\n揭開的真相\n天使高唱\n那震耳欲聾炫耀的音量\n\n誰的罪罰 誰的榮光\n誰的妄想\n難道是那些有翼的在偽裝\n握我的掌 張嘴說話\n以為是旨嗎\n織了半幕覆不起的網\n\n我的心上有 謎\n眼角有 狂\n泛起了陣殤\n\n\n默奏無聲下意志力的謊\n它不笑不喘也不慌張的\n破曉不及救贖殞落的火光\n帶走吧 那安祥\n\n\n我奔向 沒有了 回聲的回答\n卻是誰 交換了 我的瘋狂\n\n終於繞著繞著那風\n捲起微笑的洶湧\n那一幕走到了定位\n暖和的手牽著手\n\n哎唷哎唷嘆了夠久\n架起最優雅的姿態醒來\n就和諧了時鐘\n才沒有歿奏\n', 253, '', '', '', '', '', '', 1, 1, 0, '2009-01-02 19:08:10', '2015-03-12 13:36:23', '0000-00-00 00:00:00'),
