(11620, 730, 1210, 11, '怎麼可能會寂寞', '', '2008-12-31 00:00:00', 0000, 20, 0, 4, '', '作詞：吳听徹\n作曲：吳听徹\n\n我 愛上妳的時候\n也 有攜手白頭的衝動\n可惜好景不常在我們左右\n努力再過了頭 是熱情腐了朽\n\n妳 牢牢的抓緊過我生活\n卻 放開在我依賴最深的時候\n也擁擠了我 思緒沉靜的動作\n而我習慣的 也不再陪著\n\n我怎麼能聽見妳 怎麼能看見妳\n怎麼能提 怎麼能說\n怎麼有感動的曾經 怎麼能不淚流\n怎麼才能握緊妳的雙手\n然後說出口 妳是我所有的所有\n\n妳 牢牢的抓緊過我生活\n卻 放開在我依賴最深的時候\n也擁擠了我 思緒沉靜的動作\n而我習慣的 也不再陪著\n\n我怎麼能聽見妳 怎麼能看見妳\n怎麼能提 怎麼能說\n怎麼有感動的曾經 怎麼能不淚流\n怎麼才能握緊妳的雙手\n然後說出口 妳是我所有的所有\n\n\n想見她 卻不能說\n什麼啞了我\n這種對話出現太多\n當夜深人靜的時候\n她能溫暖我 也能降溫到那最寒凍\n再沒有人心痛\n\n我怎麼能聽見妳 我怎麼能看見妳\n我怎麼能提妳 怎麼能說妳\n怎麼有該死的感動的曾經\n怎麼可能不淚流\n怎麼才能握緊妳的雙手\n然後說 怎麼可能會寂寞', 268, '', '', '', '', '', '', 1, 1, 0, '2009-01-02 19:17:46', '2015-03-12 13:36:23', '0000-00-00 00:00:00'),
(11621, 730, 1210, 12, '娓奏', '', '2008-12-31 00:00:00', 0000, 20, 0, 4, '', '詞/曲：吳听徹\n編曲：日京江羽人(Jiro)\n\n\n我沒有錯 讓你愛上我\n太臭屁的人要彈耳朵\n猜拳誰硬是都只出拳頭\n害得我好痛\n\n在喂什麼 我又沒亂動\n縮在椅子上頭擠痘痘\n吹牛我就是要吹十二個六\n就算只有 你還有我\n\n\n還要奏些什麼\n還能奏些什麼東東\n才會好過 比較好過\n讓軟弱都成了我的傑作\n哭什麼 你哭什麼\n我面紙快要不夠用\n我怎麼上廁所\n\n桀瑞的錯 害你們要聽我\n唱少林功夫又配蒟蒻\n如果當晴天沒來我夢中\n就更加想罷工\n\n搞什麼 每當案子多\n全部同事就很愛翻桌\n始作俑者布丁掀起的潮流\n讓大家都變賠錢貨\n\n\n還要奏些什麼\n還能奏些什麼東東\n才會好過 比較好過\n讓軟弱都成了我的傑作\n哭什麼 你哭什麼\n我面紙快要不夠用\n誰塞一張給我\n\n還要奏些什麼\n還能奏些什麼東東\n才會好過 比較好過\n讓軟弱都成了我的傑作\n哭什麼 你哭什麼\n面紙全部都沒有囉\n捲筒的別靠近我\n\n因為我細皮嫩肉\n', 210, '', '', '', '', '', '', 1, 1, 0, '2009-01-02 19:21:22', '2015-03-12 13:36:23', '0000-00-00 00:00:00'),
(11631, 8929, 0, 1, '鐵人28(demo)', '你知不知道你是誰!?\r\n  \r\n關於現在，關於環境，關於一些疑惑...\r\n \r\n中產階級底下的人們的矛盾，\r\n \r\n希望玩彩卷搖身一變到金字塔頂端，\r\n \r\n但總是坐在家裡的客廳等待明天的工作，\r\n \r\n就像是那些偽名媛，在能買與不能買之間。\r\n \r\n \r\n最後會不會只剩下心裡的吶喊?\r\n\r\n是某種神秘力量導致一面倒的後悔嗎?', '0000-00-00 00:00:00', 0000, 0, 2, 10, '我要說的很簡單　只有抽菸的日子無聊\r\n \r\n白色的襪子丟在地上　坐下來發個彩卷的夢\r\n \r\n我說　Hello my future , goodbye the past .\r\n \r\n我要說的很簡單　打開摩托車上三個大鎖\r\n \r\n請問拿著購物帶的正妞　你要去SOGO還是十元百貨\r\n  \r\n她說　Hello my future , goodbye the past .\r\n \r\n一雙透明的手不停的在遙控我　一雙透明的手推動搖桿操縱我\r\n  \r\n一雙透明的手讓我失敗改變我　一雙透明的手此刻將要撕裂我', '', 150, '', '電腦白痴', '亦正', '電腦白痴', 'NON', '', 0, 1, 0, '2009-01-04 18:26:36', '2015-03-12 13:36:23', '0000-00-00 00:00:00'),
