(11711, 9085, 0, 1, '天蠍美人(Demo)', '', '2008-12-01 00:00:00', 0000, 0, 2, 4, '深邃的眼矇  深深的勾引住我 \r\n清淡的香唇  想偷偷親一口\r\n帶點危險  妳的浪侵襲著我\r\n美麗的天蠍  夾住就別想放手\r\nbad bad baby\r\n \r\n燈光昏暗 夜店裡的虛情假意\r\n通通靠過來 party girl沒有一個真情\r\n高腳椅上買醉  不是妳的真意\r\npub裡的女孩 都比不上神秘的妳\r\n\r\n\r\n不明白妳愛的是人還是金錢\r\n說著愛只是現代的口頭誓言\r\n妳看我對眼就可以狂歡一夜\r\n陌生的愛擦乾嘴巴又是空虛的夜\r\n\r\n(間奏)\r\n\r\n深邃的眼矇  深深的勾引住我 \r\n清淡的香唇  想偷偷親一口 \r\n帶點危險  妳的浪侵襲著我\r\n美麗的天蠍  夾住就別想放手\r\nbad bad baby\r\n\r\n燈光照過來 照在妳的身上\r\n夜晚的狼群 目光都在妳身上\r\n只有我知道  妳與別人不同\r\n不屑的態度  我想只有我懂 \r\n\r\n\r\n不明白妳愛的是人還是金錢\r\n說著愛只是現代的口頭誓言\r\n妳看我對眼就可以狂歡一夜\r\n(陌生的愛妳情我願轟轟烈烈 )\r\n陌生的愛擦乾嘴巴又是空虛的夜\r\n\r\nbad baby  kiss my body bad baby  kiss my body \r\nbad baby  kiss my body bad baby  kiss my body \r\nbad baby  kiss my uh ,  don`t stop .\r\n', '', 197, '', 'Bird', 'Bird', 'Bird', '', '', 0, 1, 0, '2009-01-05 16:16:23', '2015-03-12 13:36:26', '0000-00-00 00:00:00'),
