(11768, 315, 0, 1, 'Count (Live @ 浮現)', '慘綠青年的青春記事本\r\n沒錢吃飯買煙的生活', '0000-00-00 00:00:00', 0000, 0, 1, 7, 'ㄧ支煙　兩支煙　三支煙　喔喔\r\n四支煙　五支煙　六支煙　嘿嘿\r\n七支煙　八支煙　九支煙　答啦\r\n十支煙能夠抽多久\r\n\r\nㄧ包煙　兩包煙　三包煙　喔喔\r\n四包煙　五包煙　六包煙　嘿嘿\r\n七包煙　八包煙　九包煙　答啦\r\n十包煙能夠抽多久\r\n\r\nㄧ條煙　兩條煙　三條煙　喔喔\r\n四條煙　五條煙　六條煙　嘿嘿\r\n七條煙　八條煙　九條煙　答啦\r\n十條煙能夠抽很久\r\n', '', 203, '', 'Ever', 'Ever', '', '', '', 0, 0, 1, '2009-01-06 00:46:56', '2013-10-07 17:13:46', '0000-00-00 00:00:00'),
